from numpy import log

def de_integrate(f, a, b, target_error=1e-10, full_output=False):
    '''returns value of integral of f(x) from a to b using double
    exponentiation integration.  

    if full_output is true, returns (value, estimated error, number of
    evaluations).
    '''
    
    # linear change of variables from (a,b) to (-1, 1)
    # Int[f(x), {x,a,b}] = c*Int[f(ct+d), {t,-1,1}]
    c = float(b - a) / 2
    d = float(a + b) / 2
    
    def contribution_at_level(l):
        # _abcissas and _weights are defined below
        return 2**(-l) * sum([weight * f(c * abcissa + d) for weight, abcissa in zip(_weights[l], _abcissas[l])])


    integral = contribution_at_level(0)
    current_delta = float("inf")
    num_levels = len(_abcissas)
    
    for level in range(1, num_levels):
        new_contribution = contribution_at_level(level)
        previous_delta, current_delta = current_delta, abs(integral / 2 - new_contribution)

        integral = integral / 2 + new_contribution
        
        if current_delta == 0.0:
            break

        if level == 1:
            continue

        # both of these are nonzero, or 
        r = log(current_delta) / log(previous_delta)
        
        if 1.9 < r < 2.1:
            # If convergence theory applied perfectly, r would be 2 in the convergence region.  
            # r close to 2 is good enough. We expect the difference between this integral estimate 
            # and the next one to be roughly delta^2.
            error_estimate = c * current_delta ** 2
        else:
            # not yet converging
            error_estimate = c * current_delta * 2

        if error_estimate < 0.1 * target_error:
            break

    if full_output:
        return c * integral * _initial_step_size, _initial_step_size * error_estimate, sum([len(_abcissas[l]) for l in range(level+1)])
    else:
        return c * integral * _initial_step_size

