def _mirror_abcissas(a):
    return a + [-v for v in a if v > 0]

def _mirror_weights(w, a):
    # special case for abcissa == 0, to prevent duplicate evaluations
    return w + [v for idx, v in enumerate(w) if a[idx] > 0]

